  render() {
    return (
        <div className="row">
            <div className="col">
                <img src={PlatziConfLogo} alt=""/>
                <h1>PRINT YOUR BADGES</h1>
                <h3>The easiest way to manage your conference</h3>
            </div>
        </div>

    );
  }
}

export default HomePage;
